import { inject, Injectable } from "@angular/core";
import { Device } from "@capacitor/device";
import { ToastController } from "@ionic/angular";
import OneSignal from "onesignal-cordova-plugin";
import NotificationReceivedEvent from "onesignal-cordova-plugin/dist/NotificationReceivedEvent";
import { map, Subject, switchMap, tap } from "rxjs";

@Injectable({
  providedIn: "root"
})
export class OneSignalService {
  protected toastCtrl = inject(ToastController);
  protected notificationReceived$ = new Subject<NotificationReceivedEvent>();

  async startup() {
    const device = await Device.getInfo();

    if (device.platform === "web")
      return;

    this.notificationReceived$.pipe(
      map(nr => nr.getNotification()),
      switchMap(notification => this.toastCtrl.create({
        header: notification.title,
        message: notification.body,
        duration: 5000,
        position: "top"
      })),
      tap(toast => toast.present())
    )
    .subscribe();

    OneSignal.setAppId("");

    OneSignal.promptForPushNotificationsWithUserResponse(() => 
      OneSignal.setNotificationWillShowInForegroundHandler(notification => this.notificationReceived$.next(notification))
    );
  }
}

import { Injectable, inject } from "@angular/core"
import { createStore } from "@ngneat/elf";
import { addEntities, withEntities } from "@ngneat/elf-entities";
import { localStorageStrategy, persistState } from "@ngneat/elf-persist-state";
import { searchResultsAdapter } from "src/app/shared/adapters/search-results.adapter";
import { operativesAdapter } from "./adapters/operatives.adapter";
import { Observable, switchMap, tap } from "rxjs";
import { HttpClient } from "@angular/common/http";
import { environment } from "src/environments/environment";
import { createRequestsStatusOperator, selectIsRequestPending, updateRequestStatus, withRequestsStatus } from "@ngneat/elf-requests";

export interface Operative {
  ID: number,
  Name: string
}

export interface OperativeSearchParams {
  search: string,
  noAppLimit: boolean,
  siteId?: number
}

export interface OperativeSearchResult {
  ID: number,
  Name: string,
  CompanyName: string,
  HasQRCode: boolean,
  HasAppAccess: boolean
}

const {
  SearchResultEntitiesRef,
  withSearchResultEntities,
  searchResultsAdapt
} = searchResultsAdapter();

const store = createStore(
  { name: "operatives" },
  withEntities<Operative, "ID">({ idKey: "ID" }),
  withSearchResultEntities<OperativeSearchResult, "ID">({ idKey: "ID" }),
  withRequestsStatus<"operativesSearch">()
);

const { 
  operatives$, 
  addOperative,
  searchResults$,
  setSearchResults
} = {
  ...operativesAdapter(store),
  ...searchResultsAdapt(store)
}

const trackRequestStatus = createRequestsStatusOperator(store);

persistState(store, {
  key: "operatives",
  storage: localStorageStrategy
});

@Injectable({ providedIn: "root" })
export class OperativesStore {
  httpClient = inject(HttpClient);

  operatives$ = operatives$();
  searchResults$ = searchResults$();
  searchResultsIsPending$ = store.pipe(selectIsRequestPending("operativesSearch"));

  addOperative = addOperative;
  setSearchResults = setSearchResults;

  getSearchResults = (action$: Observable<OperativeSearchParams>) => action$.pipe(
    switchMap(params => this.httpClient.get<OperativeSearchResult[]>(`${environment.siteDocsApi}/OperativeApi/GetOperativesByName`, {
      params: {
        search: params.search,
        noAppLimit: params.noAppLimit,
        siteId: params.siteId?.toString() || "null"
      }
    })),
    trackRequestStatus("operativesSearch"),
    tap(searchResults => store.update(
      addEntities(searchResults, { ref: SearchResultEntitiesRef }),
      updateRequestStatus("operativesSearch", "success")
    ))
  );
}

import { Injectable } from "@angular/core";
import { createStore } from "@ngneat/elf";
import { addEntities, deleteEntitiesByPredicate, selectAllEntitiesApply, withEntities } from "@ngneat/elf-entities";
import { SiteDocument, SiteDocumentImage } from "../site-document/models/site-document.model";

const store = createStore(
  { name: "site-document-image" }, 
  withEntities<SiteDocumentImage, "DocumentId">({ idKey: "DocumentId" })
);

@Injectable({ providedIn: "root" })
export class SiteDocumentImageStore {
  useImages(document: SiteDocument) {
    return [
      store.pipe(
        selectAllEntitiesApply({
          filterEntity: e => e.DocumentId === document.DocumentID
        })
      ),

      (images: string[]) => store.update(
        deleteEntitiesByPredicate(e => e.DocumentId === document.DocumentID),
        addEntities(images.map((img, idx) => 
          ({
            DocumentId: document.DocumentID,
            DocumentSubmissionId: 1,
            Base64: img,
            ImageNo: idx
          })
        ))
      )
    ]
  }
}

