  @Input()
  queues: Array<{ id: number, name: string }> = [];

  @Input()
  queueId: number | null = null;

  @Output()
  queueIdChange = new EventEmitter<number>();

  value$: Observable<{ id: number, name: string } | null> = merge(
    this.afterViewInit$,
    this.input$("queueId")
  ).pipe(
    map(() => this.queues.find(q => q.id === this.queueId) || null)
